import react from 'react';

const MobileMenu = () => {
    return (
        <div class="mobile-menu">
            <ul class="button">
                <li><a href="/calculator.html">Calculator</a></li>
                <li><a href="/rates.html">Rates</a></li>
            </ul>
        </div>
    )
}

export default MobileMenu;
